import React from 'react';
import { Container, Row, Col } from 'reactstrap'

function PlaneCard(props) {
    return (
        <Col xs="4">
            <img src={props.card.image_uris.jpg} />
        </Col>
    )
}



export default function Planechase(props) {
    return (
        <Container>
            <Row>
                {props.planechaseState.allPlaneCards.map((card, idx) => card.name)}
            </Row>
        </Container>
    )
}
